import React from "react"
import {withRouter} from 'react-router-dom';

import "../css/footer.css"

function Footer(){
    return(
        <div className="footer-container">
            <p className="footer-text">Powered by MERN</p>
        </div>
    )
}

export default withRouter(Footer);
